import React from "react";

import * as css from "../../utils/cssVariables";

const RequestCommunityPage: React.FC = () => {
  return (
    <React.Fragment>
      <div className="request-community-container">
        <p>Community</p>
      </div>

      <style jsx>{`
        .request-community-container {
          height: 200px;
          width: 200px;
          border: 1px solid red;
          position: absolute;
          left: 50%;
          transform: translate(-50%, 0);
        }
      `}</style>
    </React.Fragment>
  );
};

export default RequestCommunityPage;
